void draw_char_on_framebuffer(uint8_t *frame_buffer, char character, uint8_t dest_column, uint8_t dest_row)
{
	/* Get the even/odd source data */
	uint8_t *source_data = (dest_column % 2 == 1) ? (uint8_t *)firacode20_font_table_odd : (uint8_t *)firacode20_font_table;

	/* Map character to a position in our font file */
	uint16_t src_pixel_index = firacode20_font_map[(character - 32)];
	uint8_t *src_pixel = source_data + src_pixel_index;
	
	/* Desination column row and pixel */
	/* column = (n * 6) + (n / 2) */	
	uint16_t dest_column_pixel_index = (dest_column * DEST_FONT_WIDTH) + (dest_column / 2);
	uint16_t dest_pixel_index = dest_column_pixel_index + (FRAMEBUFFER_WIDTH * (FONT_HEIGHT + 2) * dest_row);
		
	/* Find the destination position in frame buffer */
	uint8_t *dest_pixel = frame_buffer + dest_pixel_index;

	/* Loop over rows until we copy all the column values */
	for (uint8_t i = 0; i < FONT_HEIGHT; ++i)
	{
		for (uint8_t j = 0; j < SOURCE_FONT_WIDTH; ++j)
		{
			/* OR the contents of source with dest */
			*(dest_pixel + j + (i * FRAMEBUFFER_WIDTH)) |= *(src_pixel + j + (i * FONT_ROW_WIDTH));
		}
	}
}






